import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const A112 = (props) => {
  const { route } = props
  const { name } = route.params

  return (
    <View
      style={{
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <Text
        style={{
          fontSize: 30,
          fontWeight: 'bold',
          color: '#111',
        }}
      >
        {name}
      </Text>
    </View>
  )
}

export default A112

const styles = StyleSheet.create({})
